import{_ as i,o,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 59.1-92.6 Certificate of registration.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-92.6.md","filePath":"vacode/59.1-92.6.md"}'),r={name:"vacode/59.1-92.6.md"},n=e("h1",{id:"§-59-1-92-6-certificate-of-registration",tabindex:"-1"},[t("§ 59.1-92.6 Certificate of registration. "),e("a",{class:"header-anchor",href:"#§-59-1-92-6-certificate-of-registration","aria-label":'Permalink to "§ 59.1-92.6 Certificate of registration."'},"​")],-1),s=e("p",null,"Upon compliance by the applicant with the requirements of this chapter, the Commission shall cause a certificate of registration to be issued and delivered to the applicant. The certificate shall show (i) the name and business address of the registrant and, if a corporation, limited liability company, partnership, limited liability partnership, or any other legal entity, the state or other jurisdiction of incorporation, formation, or organization, as the case may be; (ii) the date claimed for the first use of the mark anywhere and the date claimed for the first use of the mark in this Commonwealth; (iii) the class of goods or services and a description of the goods or services on or in connection with which the mark is used; (iv) a reproduction of the mark; and (v) the registration date and the term of the registration.",-1),c=e("p",null,"Any certificate of registration issued by the Commission under the provisions hereof or a copy thereof duly certified by the clerk of the Commission shall be prima facie evidence of the registrant's ownership of the mark, and of the registrant's exclusive right to use the registered mark within the Commonwealth on or in connection with the goods or services specified in the certificate, and shall be admissible in evidence as competent and sufficient proof of the registration of such mark in any actions or judicial proceedings in any court of this Commonwealth.",-1),h=e("p",null,[t("1998, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0819",target:"_blank",rel:"noreferrer"},"819"),t(".")],-1),d=[n,s,c,h];function f(l,m,p,g,u,_){return o(),a("div",null,d)}const y=i(r,[["render",f]]);export{b as __pageData,y as default};
